import comLab from '../../label-template/component/com-lab.vue'
import html2canvas from 'html2canvas'
import { ref, reactive, watch, defineExpose } from 'vue'
import { getlabList, exportLabel, exportLabelAll } from '@/service/dataAnalysisApi'
import { BASE_URL } from '@/service/request/config'
import { ElMessage } from 'element-plus'
const props = defineProps({
  search: String
})
// const { search } = toRefs(props)
const modelShow = ref(false)
const dataAll: any = reactive({
  formData: {
    total: 10,
    page: 1,
    note_type: 1,
    title: ''
  },
  tableData: [],
  expLabel: {
    template: 1,
    source_id: null,
    source_type: 1
  }
})
watch(
  props,
  (old, newProps: any) => {
    console.log('=======', newProps) //这里看到新值
    dataAll.formData.title = newProps.search
  },
  {
    // immediate: true, //立即开始监听
    deep: true // 深度监听
  }
)

// 分页
const handleCurrentChange = (val: number) => {
  dataAll.formData.page = val
  getTable()
}
const loading = ref(false)
let infoData: any = ref({})
let field: any = ref({})
// 更新数据
const getTable = () => {
  loading.value = true
  console.log('获取数据')
  console.log(dataAll.formData)
  getlabList(dataAll.formData).then((res: any) => {
    console.log(res)
    dataAll.formData.total = res.data.page_info.count
    dataAll.tableData = res.data.list
    console.log(res.data.list)
    loading.value = false
    let obj = res.data.selected_note_template
    infoData.value.color = obj.color
    infoData.value.type = obj.type
    infoData.value.source = obj.source
    infoData.value.source_id = obj.source_id
    if (typeof obj.extra === 'string' && obj.extra !== '') {
      let reg1 = /&quot;/g
      let extra = obj.extra.replace(reg1, '"')
      obj.extra = JSON.parse(extra)
      obj = { ...obj, ...obj.extra }
    }
    field.value = obj
    if (obj.header) {
      infoData.value.header = obj.header
    }
    if (obj.imgUrl) {
      infoData.value.imgUrl = obj.imgUrl
    }
    if (obj.isSchool_logo) {
      infoData.value.isSchool_logo = obj.isSchool_logo
    }
  })
}
getTable()
const sigle = ref(false)
const exportTem = () => {
  // infoData.value.qr_code = infoData.value.qr_code.replace('http', 'https')
  // infoData.value.deviceName = infoData.value.title
  // infoData.value.school_logo = infoData.value.school_logo.replace('https', 'http')
  console.log(1111, infoData.value)
  setTimeout(() => {
    let id: any = document.querySelector('.comLab')

    html2canvas(id, {
      // taintTest: false,
      allowTaint: false,
      useCORS: true, //允许跨域
      backgroundColor: infoData.value.color || '#fff', //画布背景色，设置null为透明
      scale: 2, // 处理模糊问题
      dpi: 300 // 处理模糊问题
    }).then((canvas) => {
      // 返回一个 canvas 对象，在dom中渲染 canvas 对象
      // 转化成 dataurL
      let url = canvas.toDataURL('image/png')
      // console.log(198, url)
      //调用下载方法
      let a = document.createElement('a') //创建一个a标签
      a.download = '实验室标签.png' // 设置图片名称
      a.href = url // 将生成的URL设置为a.href属性
      a.click()
      sigle.value = false
    })
  }, 100)
}
const disabled = ref(false)
const examineExport = (row: any) => {
  if (infoData.value.source_id === 0) {
    ElMessage({
      type: 'warning',
      message: '您还未设置具体的模版，请至标签模版中进行设置后再导出！'
    })
    return
  }
  infoData.value = { ...infoData.value, ...row }
  infoData.value.school = row.school_name
  if (field.value.source === 1) {
    if (field.value.source_id === 3) {
      delete infoData.value.school
    }
  } else {
    if (!field.value.school) {
      delete infoData.value.school
    }
    if (!field.value.title) {
      delete infoData.value.title
    }
  }
  sigle.value = true
  exportTem()
}
const exportSingle = () => {
  if (sigle.value) {
    console.log(444444)
    let url =
      BASE_URL +
      '/schooldvc/SchoolNotes/exportNoteTemplate?template=' +
      dataAll.expLabel.template +
      '&source_id=' +
      dataAll.expLabel.source_id +
      '&source_type=' +
      dataAll.expLabel.source_type
    downloadTxtNext(url)
  } else {
    console.log(555555)
    // let a = document.createElement('a') //创建a标签
    // ids.value.forEach((e) => {
    //   let url =
    //     BASE_URL+'/schooldvc/SchoolNotes/exportNoteTemplate?template=' +
    //     dataAll.expLabel.template +
    //     '&source_id=' +
    //     e +
    //     '&source_type=' +
    //     dataAll.expLabel.source_type

    //   setTimeout(function () {
    //     downloadTxtNext(url)
    //   }, 3000)
    // })
    let i = 0
    let time = setInterval(function () {
      if (i < ids.value.length) {
        let url =
          BASE_URL +
          '/schooldvc/SchoolNotes/exportNoteTemplate?template=' +
          dataAll.expLabel.template +
          '&source_id=' +
          ids.value[i] +
          '&source_type=' +
          dataAll.expLabel.source_type
        downloadTxtNext(url)
        i++
      } else {
        clearInterval(time)
      }
    }, 2000)
  }
}
const downloadTxtNext = (href: string) => {
  let a = document.createElement('a') //创建a标签
  a.href = href //设置下载地址
  a.click() //给指定的元素，执行事件click事件
}
// 批量导出
const ids = ref([])
const allExport = () => {
  console.log('批量导出')
  let i = 0
  let time = setInterval(function () {
    if (i < ids.value.length) {
      let obj = ref({})
      obj = ids.value[i]
      infoData.value = { ...infoData.value, ...obj }
      sigle.value = true
      examineExport(ids.value[i])
      i++
    } else {
      clearInterval(time)
    }
  }, 2000)
}
const handleSelectionChange = (val: any) => {
  ids.value = []
  ids.value = val.map((e: any) => {
    return e
  })
  console.log(ids.value)
}
